import React from 'react'

export default function Table({headings,data}) {
    console.log(data)
  return (
    <table class="table table-hover">
    <thead>
      <tr>
          {headings.map((item)=>{
              return <th scope="col">{item}</th>

          })}
      </tr>
    </thead>
    <tbody>
        {data.map((item)=>{
            return (
                <tr>
                    {Object.keys(item).map((it)=>{
                        item[it]
                    })}
                </tr>
            )

        })}

    </tbody>
  </table>  )
}
